Sure, here's an example of a JSON file containing SNP data for TP53 codon 12:
```json
[
  {
    "snp_name": "rs17256019",
    "allele1": "G",
    "allele2": "A"
  },
  {
    "snp_name": "rs15877442",
    "allele1": "C",
    "allele2": "T"
  },
  {
    "snp_name": "rs147276029",
    "allele1": "CA",
    "allele2": "AA"
  }
]
```
In the JSON file each element represents a different SNP and includes the SNP name (rs#), the two possible alleles, and whether the codon is deleted or not (if it is deleted, the alleles are "del").
